import React, { Component } from "react";
import { 
  MDBContainer,
} from "mdbreact";
import { BrowserRouter as Router, Route} from 'react-router-dom'
import Contenedor from "./componentes/Contenedor"
import "./index.css";

class App extends Component {
  render() {
    return (
      <MDBContainer fluid>
        <Contenedor />
      </MDBContainer>
    );
  }
}

export default App;
